import React from "react";

import "./HornedBeast.css";

export default function HornedBeast({ props }) {
  return (
    <div className="beast-div">
      <h2>{props.title}</h2>
      <img className="img" src={props.imgUrl} alt={props.title}></img>
      <p>{props.description}</p>
    </div>
  );
}
